DROP TABLE IF EXISTS url
CREATE TABLE `url` (  `urlid` int(10) unsigned NOT NULL auto_increment,  `userid` int(10) unsigned default NULL,  `url` varchar(250) NOT NULL,  `name` char(30) NOT NULL,  `urltype` smallint(6) NOT NULL default '1',  `furls` text,  `usefurl` smallint(6) default '0',  `turl` varchar(250) default '',  `useturl` smallint(6) default '0',  `usepop` smallint(6) default '0',  `rtime` datetime default NULL,  `ltime` datetime default NULL,  `free` smallint(6) default '1',  `clickother` int(10) unsigned default '0',  `clickself` int(10) unsigned default '0',  `tdclick` int(10) unsigned default '0',  `online` smallint(6) default '0',  PRIMARY KEY  (`urlid`),  KEY `userid` (`userid`),  CONSTRAINT `url_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `users` (`userid`)) ENGINE=InnoDB DEFAULT CHARSET=latin1
